import React from 'react';
// import './App.scss';
import { NavLink } from 'react-router-dom';


const Main = () => (
  <nav>
    <ul>
      <li><NavLink exact path='/pages/work'>Home</NavLink></li>
      <li><NavLink exact path='/pages/about'>About</NavLink></li>
    </ul>
  </nav>
);

export default Main;
